import React from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';

// --- Icon Components ---
// These are now mainly for the user action buttons on the right
const SettingsIcon = () => <svg style={styles.icon} fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10.325 4.317c.426-1.756 2.924-1.756 3.35 0a1.724 1.724 0 002.573 1.066c1.543-.94 3.31.826 2.37 2.37a1.724 1.724 0 001.065 2.572c1.756.426 1.756 2.924 0 3.35a1.724 1.724 0 00-1.066 2.573c.94 1.543-.826 3.31-2.37 2.37a1.724 1.724 0 00-2.572 1.065c-.426 1.756-2.924 1.756-3.35 0a1.724 1.724 0 00-2.573-1.066c-1.543.94-3.31-.826-2.37-2.37a1.724 1.724 0 00-1.065-2.572c-1.756-.426-1.756-2.924 0-3.35a1.724 1.724 0 001.066-2.573c-.94-1.543.826-3.31 2.37-2.37.996.608 2.296.096 2.572-1.065zM15 12a3 3 0 11-6 0 3 3 0 016 0z" /></svg>;
const HelpIcon = () => <svg style={styles.icon} fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8.228 9c.549-1.165 2.03-2 3.772-2 2.21 0 4 1.343 4 3 0 1.4-1.278 2.575-3.006 2.907-.542.104-.994.54-.994 1.093m0 3h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" /></svg>;
const ProfileIcon = () => <svg style={styles.icon} fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" /></svg>;
const LogoutIcon = () => <svg style={styles.icon} fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17 16l4-4m0 0l-4-4m4 4H7m6 4v1a3 3 0 01-3 3H6a3 3 0 01-3-3V7a3 3 0 013-3h4a3 3 0 013 3v1" /></svg>;

// --- Navigation Links Data ---
const navLinks = [
  { to: "/services", text: "Dashboard" },
  { to: "/tourists", text: "Tourists" },
  { to: "/incidents", text: "Incidents & Alerts" },
  { to: "/reports-analytics", text: "Reports & Analytics" },
  { to: "/help-support", text: "Help & Support" },
 
  { to: "/map-geo-fencing", text: "Map & Geo-fencing" }, 
];

function Header() {
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    navigate('/login');
  };

  return (
    <div style={styles.header}>
      <div style={styles.headerContent}>
        {/* --- Left Section --- */}
        <div style={styles.headerLeft}>
          <div style={styles.logoContainer}>
            <div style={styles.logo}>
              <svg style={styles.logoIcon} fill="currentColor" viewBox="0 0 24 24"><path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z" /></svg>
            </div>
            <span style={styles.logoText}>SAHYatri</span>
          </div>
          <nav style={styles.navigation}>
            {navLinks.map((link) => (
              <Link
                key={link.to}
                to={link.to}
                style={location.pathname.startsWith(link.to) ? styles.navLinkActive : styles.navLink}
              >
                {link.text}
              </Link>
            ))}
          </nav>
        </div>

        {/* --- Right Section --- */}
        <div style={styles.headerRight}>
          <Link to="/settings-admin" style={styles.navLink} title="Settings & Admin"><SettingsIcon /></Link>
          <Link to="/help-support" style={styles.navLink} title="Help & Support"><HelpIcon /></Link>
          <div style={styles.divider}></div>
          <Link to="/profile" style={styles.userButton} title="Profile">
             <ProfileIcon />
             <span style={styles.buttonText}>Profile</span>
          </Link>
          <button onClick={handleLogout} style={{...styles.userButton, ...styles.logoutButton}} title="Logout">
             <LogoutIcon />
             <span style={styles.buttonText}>Logout</span>
          </button>
        </div>
      </div>
    </div>
  );
}

// --- Styles for Header ---
const styles = {
  header: {
    width: '100%',
    backgroundColor: '#003366',
    color: 'white',
    padding: '10px 0',
    boxShadow: '0 2px 10px rgba(0,0,0,0.2)',
  },
  headerContent: {
    maxWidth: '1400px',
    margin: '0 auto',
    padding: '0 20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  headerLeft: {
    display: 'flex',
    alignItems: 'center',
    gap: '40px',
  },
  logoContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '15px',
  },
  logo: {
    backgroundColor: '#007bff',
    borderRadius: '50%',
    padding: '8px',
    display: 'flex',
  },
  logoIcon: { width: '24px', height: '24px' },
  logoText: { fontSize: '1.5em', fontWeight: 'bold' },
  navigation: {
    display: 'flex',
    gap: '25px',
  },
  navLink: {
    color: '#e9ecef',
    textDecoration: 'none',
    fontSize: '1em',
    padding: '10px 0',
    position: 'relative',
    transition: 'color 0.2s ease',
  },
  navLinkActive: {
    color: 'white',
    textDecoration: 'none',
    fontSize: '1em',
    padding: '10px 0',
    position: 'relative',
    fontWeight: '500',
    borderBottom: '2px solid #007bff', // Active indicator
  },
  headerRight: {
    display: 'flex',
    alignItems: 'center',
    gap: '20px',
  },
  icon: {
    width: '24px',
    height: '24px',
    color: '#e9ecef'
  },
  divider: {
    width: '1px',
    height: '24px',
    backgroundColor: '#004488',
  },
  userButton: {
    display: 'flex',
    alignItems: 'center',
    gap: '8px',
    padding: '8px 15px',
    borderRadius: '8px',
    textDecoration: 'none',
    backgroundColor: 'transparent',
    border: '1px solid #004488',
    cursor: 'pointer',
    transition: 'background-color 0.2s ease',
  },
  logoutButton: {
    color: '#ff8a8a',
  },
  buttonText: {
    color: '#e9ecef',
    fontSize: '0.9em',
  },
};

export default Header;
